import './App.css'; // Import CSS for custom styling

function Aboutus() {
  return (
    <div className="about-container">
      <div className="banner-left"></div>
      <div className="about-content">
        <h2>About Us</h2>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam id turpis sed magna fermentum consequat. Nam ultricies lorem eu velit consequat, vel hendrerit ligula varius. Nullam ac libero eu ex lacinia dignissim. Sed ut dictum velit. Duis auctor turpis vel magna mollis, eget lacinia quam fermentum.</p>
